import React, { Component } from 'react';

class App extends Component {
  constructor() {
    super();
    this.state = {};
  }

  componentDidMount() {
    fetch('https://jsonplaceholder.typicode.com/todos/1').then((response) =>
      console.log(response.json())
    );
  }

  render() {
    return <div></div>;
  }
}

export default App;
